    COALESCE( t1."Leaf_4", t1."Leaf_7", t1."Leaf_12", t1."Leaf_13", t1."Leaf_21", t1."Leaf_23", t1."Leaf_24", t1."Leaf_25", t1."Leaf_27", t1."Leaf_28", t1."Leaf_29", t1."Leaf_32", t1."Leaf_35", t1."Leaf_36", t1."Leaf_38", t1."Leaf_40", t1."Leaf_42", t1."Leaf_43", t1."Leaf_45", t1."Leaf_46", t1."Leaf_47", t1."Leaf_49", t1."Leaf_51", t1."Leaf_53", t1."Leaf_54", t1."Leaf_55", t1."Leaf_60", t1."Leaf_62", t1."Leaf_63", t1."Leaf_64", t1."Leaf_65", t1."Leaf_66", t1."Leaf_67", t1."Leaf_69", t1."Leaf_70", t1."Leaf_71", t1."Leaf_75", t1."Leaf_76", t1."Leaf_81", t1."Leaf_83", t1."Leaf_84", t1."Leaf_89", t1."Leaf_90", t1."Leaf_91", t1."Leaf_93", t1."Leaf_94", t1."Leaf_96", t1."Leaf_97", t1."Leaf_99", t1."Leaf_100", t1."Leaf_103", t1."Leaf_109", t1."Leaf_110", t1."Leaf_111", t1."Leaf_112", t1."Leaf_114", t1."Leaf_115", t1."Leaf_116", t1."Leaf_120", t1."Leaf_121", t1."Leaf_122", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_10" > 1.500000) AND (t."X_10" > 2.500000)) THEN 4 ELSE NULL END AS "Leaf_4",
