      CASE WHEN((t."X_10" > 1.500000) AND (t."X_10" <= 2.500000) AND (t."X_0" <= 1.500000) AND (t."X_0" <= 0.500000) AND (t."X_12" > 2.500000) AND (t."X_4" <= 9.500000) AND (t."X_2" > 155915.500000) AND (t."X_2" <= 179125.000000)) THEN 27 ELSE NULL END AS "Leaf_27",
